import { Title, Wrap } from "../styled";
import { Img } from "./styled";

interface Props {
  imgUrl: string;
  title: string;
}

export default function CompanyCard(props: Props) {
  return (
    <Wrap>
      <Img src={props.imgUrl} alt="Company" />
      <Title>{props.title}</Title>
    </Wrap>
  );
}
